import React from "react";

export default function HighScoreTable(props) {
  const country = props.data.map((element) => <td>{element.name}</td>);
  const scores = props.data.map((el) => (
    <tr>
      <td>{el.scores.map((e) => e.n)}</td>
      <td>{el.scores.map((e) => e.s)}</td>
    </tr>
  ));
  return (
    <table>
      <thead>{country}</thead>
      <tbody>{scores}</tbody>
    </table>
  );
}
